import React, { Component } from "react";
import HeaderPage from ".//HeaderPage";
import TabPane from "./TabPane";
import GirdData from "./GirdData";
import Navigator from "./Navigator";
import Modal from "./Modal";
import {Send_Get_RestAPI} from '../../../Request/imw_request'

export class ContentStaff extends Component {
  constructor(props) {
    super(props);
    this.state ={
      loading:false
    }
  }

  async componentDidMount () {
    const res = await Send_Get_RestAPI('http://localhost:3001/staff')//them vo
    const data = await res.json();
    this.setState({data : data , loading:false}); 
  }
  render() {
    return (
      <div className="page-content-wrapper">
        <div className="page-content">
          <HeaderPage />
          <div className="row">
            <div className="col-md-12">
              <div className="tabbable-line">
                <Navigator />
                <div className="tab-content">
                  {this.state.loading ? <div>loading...</div> : <div>data...</div>}
                  <GirdData />
                  <TabPane />
                  <Modal />
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ContentStaff;
